import './Search.css';

export default function Search() {
  return (
    <div>
      <input
        type='text'
        value={url}
        onChange={(e) => {
          setUrl(e.target.value);
        }}
        placeholder='Paste listing URL'></input>
      <button
        type='submit'
        onClick={(e) => {
          submitUrl(e);
        }}>
        Submit
      </button>
    </div>
  );
}
